    <g transform="matrix(1, 0, 0, 1, 299.69952, 76.72363)"><text font-family="Calibri" font-style="normal" font-weight="normal" font-stretch="normal" font-size="18pt" fill="#000000" x="27" y="252.86401"><tspan x="0" y="22.464">In 1859, Swiss entrepreneur</tspan><tspan xml:space="preserve" x="272.1953" y="22.464"> </tspan><tspan x="27" y="51.264" font-weight="bold">Jean Henri Dunant</tspan><tspan xml:space="preserve" x="210.90234" y="51.264" font-weight="bold"> </tspan><tspan x="216.27734" y="51.264" textLength="94.6875">organized</tspan><tspan xml:space="preserve" x="310.96484" y="51.264" textLength="5.375"> </tspan><tspan x="27" y="80.063995">the inhabitants of the</tspan><tspan xml:space="preserve" x="237.73438" y="80.063995"> </tspan><tspan x="27" y="108.864">surrounding villages to help</tspan><tspan xml:space="preserve" x="295.8047" y="108.864"> </tspan><tspan x="27" y="137.664">the 9,000 wounded at at the</tspan><tspan xml:space="preserve" x="304.20703" y="137.664"> </tspan><tspan x="27" y="166.464">Battle of Solferino. Thanks to</tspan><tspan xml:space="preserve" x="307.8828" y="166.464"> </tspan><tspan x="27" y="195.264">his efforts, in in 1863. the</tspan><tspan xml:space="preserve" x="274.92578" y="195.264"> </tspan><tspan x="27" y="224.06401">International Committee of</tspan><tspan xml:space="preserve" x="292.44922" y="224.06401"> </tspan><tspan x="27" y="252.86401">the Red Cross.</tspan></text></g>

    <g transform="matrix(1, 0, 0, 1, 265.94928, 76.72362)"><text font-family="Calibri" font-style="normal" font-weight="normal" font-stretch="normal" font-size="18pt" fill="#000000" x="27" y="253.49767"><tspan x="0" y="20.2176">In 1878, the concept of</tspan><tspan xml:space="preserve" x="225.07031" y="20.2176"> </tspan><tspan x="27" y="46.1376">teaching the concept of</tspan><tspan xml:space="preserve" x="256.9375" y="46.1376"> </tspan><tspan x="27" y="72.0576">teaching a course in first</tspan><tspan xml:space="preserve" x="263.95312" y="72.0576"> </tspan><tspan x="27" y="97.9776">aid to teach first aid to</tspan><tspan xml:space="preserve" x="245.84375" y="97.9776"> </tspan><tspan x="27" y="123.8976">civilians to the civilian</tspan><tspan xml:space="preserve" x="239.76562" y="123.8976"> </tspan><tspan x="27" y="149.81761">population. One of the one</tspan><tspan xml:space="preserve" x="290.90234" y="149.81761"> </tspan><tspan x="27" y="175.73763">of the creators of this of</tspan><tspan xml:space="preserve" x="261.1914" y="175.73763"> </tspan><tspan x="27" y="201.65764">the concept was was a</tspan><tspan xml:space="preserve" x="245.90625" y="201.65764"> </tspan><tspan x="27" y="227.57765">British military surgeon</tspan><tspan xml:space="preserve" x="252.67188" y="227.57765"> </tspan><tspan x="27" y="253.49767" font-weight="bold">Peter Shepherd.</tspan></text></g>

    <g transform="matrix(1, 0, 0, 1, 46.572784, 59.848503)"><text font-family="Calibri" font-style="normal" font-weight="bold" font-stretch="normal" font-size="18pt" fill="#000000" x="27" y="195.264"><tspan x="0" y="22.464">Stage 1. Maintaining blood circulation by closed (indirect) cardiac</tspan><tspan xml:space="preserve" x="647.53125" y="22.464"> </tspan><tspan x="27" y="51.264">massage:</tspan><tspan x="0" y="80.063995" font-weight="normal">1. The victim must be on a firm, level surface (table, couch, floor).</tspan><tspan xml:space="preserve" x="637.41797" y="80.063995" font-weight="normal"> </tspan><tspan x="27" y="108.864" font-weight="normal">The use of this base is necessary to prevent displacement of the</tspan><tspan xml:space="preserve" x="648.14453" y="108.864" font-weight="normal"> </tspan><tspan x="27" y="137.664" font-weight="normal">victim's body during indirect cardiac massage. It is also necessary</tspan><tspan xml:space="preserve" x="658.6992" y="137.664" font-weight="normal"> </tspan><tspan x="27" y="166.464" font-weight="normal">to elevate the patient's legs to ensure blood flow to the brain. to</tspan><tspan xml:space="preserve" x="653.1406" y="166.464" font-weight="normal"> </tspan><tspan x="27" y="195.264" font-weight="normal">the brain.</tspan></text></g>

    <g transform="matrix(1, 0, 0, 1, 46.572784, 59.84851)"><text font-family="Calibri" font-style="normal" font-weight="normal" font-stretch="normal" font-size="18pt" fill="#000000" x="27" y="195.264"><tspan x="0" y="22.464">3. Indirect cardiac massage should be performed vigorously,</tspan><tspan xml:space="preserve" x="581.8164" y="22.464"> </tspan><tspan x="27" y="51.264">pushing, using the weight of the upper half of the body. When it</tspan><tspan xml:space="preserve" x="650.2539" y="51.264"> </tspan><tspan x="27" y="80.063995">is noted pushing blood out of the heart chambers along the the</tspan><tspan xml:space="preserve" x="643.70703" y="80.063995"> </tspan><tspan x="27" y="108.864">vascular channel. During compression is inadmissible</tspan><tspan xml:space="preserve" x="541.5078" y="108.864"> </tspan><tspan x="27" y="137.664">displacement the palms of the hands relative to the sternum.</tspan><tspan xml:space="preserve" x="621.8672" y="137.664"> </tspan><tspan x="27" y="166.464">Closed heart massage is carried out with a frequency of 100-120</tspan><tspan xml:space="preserve" x="651.66016" y="166.464"> </tspan><tspan x="27" y="195.264">pressures per minute.</tspan></text></g>
    <g transform="matrix(1, 0, 0, 1, 24.072601, 14.84819)"><text font-family="Calibri" font-style="normal" font-weight="bold" font-stretch="normal" font-size="18pt" fill="#000000" x="228.38907" y="22.464"><tspan x="228.38907" y="22.464">Resuscitative measures</tspan></text></g>

    <g transform="matrix(1, 0, 0, 1, 46.572784, 59.848503)"><text font-family="Calibri" font-style="normal" font-weight="bold" font-stretch="normal" font-size="18pt" fill="#000000" x="27" y="166.464"><tspan x="0" y="22.464">Stage 2. Restoring and maintaining patency of the airway:</tspan><tspan x="0" y="80.063995">1. Tilting the head.</tspan><tspan xml:space="preserve" x="186.25" y="80.063995"> </tspan><tspan x="191.625" y="80.063995" textLength="424.98438" font-weight="normal">This technique is carried out as follows: one</tspan><tspan xml:space="preserve" x="616.6094" y="80.063995" textLength="5.375" font-weight="normal"> </tspan><tspan x="27" y="108.864" font-weight="normal">hand is placed under the victim's neck victim and lifted as high as</tspan><tspan xml:space="preserve" x="660.7422" y="108.864" font-weight="normal"> </tspan><tspan x="27" y="137.664" font-weight="normal">possible. The other hand is placed on the forehead and pressure</tspan><tspan xml:space="preserve" x="652.0469" y="137.664" font-weight="normal"> </tspan><tspan x="27" y="166.464" font-weight="normal">is applied to the head.</tspan></text></g>

    <g transform="matrix(1, 0, 0, 1, 46.572784, 59.848503)"><text font-family="Calibri" font-style="normal" font-weight="bold" font-stretch="normal" font-size="18pt" fill="#000000" x="27" y="108.864"><tspan x="0" y="22.464">2. Move the lower jaw forward and open the mouth.</tspan><tspan x="524.0117" y="22.464" textLength="111.11719" font-weight="normal">After tilting</tspan><tspan xml:space="preserve" x="635.1289" y="22.464" textLength="5.375" font-weight="normal"> </tspan><tspan x="27" y="51.264" font-weight="normal">the head back, two hands grab the victim's lower jaw near the</tspan><tspan xml:space="preserve" x="631.1914" y="51.264" font-weight="normal"> </tspan><tspan x="27" y="80.063995" font-weight="normal">auricular auricle. Then use your thumbs to pull the lower jaw jaw</tspan><tspan xml:space="preserve" x="658.3594" y="80.063995" font-weight="normal"> </tspan><tspan x="27" y="108.864" font-weight="normal">forward, which causes the mouth to open.</tspan></text></g>
